import { useState } from 'react';
import { useSelector } from 'react-redux'
import { Output } from '../components/blocks/form'

const Bill = () => {
  const selector = useSelector(state=>state.todos)
  const [select,setSelect] = useState([]);
  setSelect(state=>state=selector);
  return (
    <section className='bill'>
      <form action="#">
        {
          selector.map((id, el)=>{
            <Output name={id} service={el}/>
          })
        }
      </form>
    </section>
  );
};

export default Bill;
